s/placeholder.png" src="data:image/png;base64,"><!----><!----><div _ngcontent-c9=""><figcaption _ngcontent-c9="" class="ft13 tgreydark pad10 ptop">Idea Netsetter</figcaption></div></a></span><!----><span _ngcontent-c9="" hidden=""><a _ngcontent-c9="" class="csrPtr" href="/tata-photon-plus-prepaid-plans"><img _ngcontent-c9="" alt="Tata Photon Bill Payment" data-savepage-src="/assets/images/placeholder.png" src="data:image/png;base64,"><!----><!----><div _ngcontent-c9=""><figcaption _ngcontent-c9="" class="ft13 tgreydark pad10 ptop">Tata Photon</figcaption></div></a></span><!----><span _ngcontent-c9="" hidden=""><a _ngcontent-c9="" class="csrPtr" href="/mumbai-metro-card-recharge-online"><img _ngcontent-c9="" alt="Mumbai Metro Bill Payment" data-savepage-src="/assets/images/placeholder.png" src="data:image/png;base64,"><!----><!----><div _ngcontent-c9=""><figcaption _ngcontent-c9="" class="ft13 tgreydark pad10 ptop">Mumbai Metro</figcaption></div></a></span><!----><span _ngcontent-c9="" hidden=""><a _ngcontent-c9="" class="csrPtr" href="/ap-traffic-police-challan-payment"><img _ngcontent-c9="" alt="Andhra Pradesh Traffic Police Bill Payment" data-savepage-src="/assets/images/placeholder.png" src="data:image/png;base64,"><!----><!----><div _ngcontent-c9=""><figcaption _ngcontent-c9="" class="ft13 tgreydark pad10 ptop">Andhra Pradesh Traffic Police</figcaption></div></a></span><!----><span _ngcontent-c9="" hidden=""><a _ngcontent-c9="" class="csrPtr" href="/mcg-property-tax-payment"><img _ngcontent-c9="" alt="Municipal Corporation of Gurgaon (MCG) Bill Payment" data-savepage-src="/assets/images/placeholder.png" src="data:image/png;base64,"><!----><!----><div _ngcontent-c9=""><figcaption _ngcontent-c9="" class="ft13 tgreydark pad10 ptop">Municipal Corporation of Gurgaon (MCG)</figcaption></div></a></span></div></section></mbk-seo-footer><hr _ngcontent-c8="" class="smtop20 smbottom20"><!----><section _ngcontent-c8="" class="typoRuleseo"><!----><div _ngcontent-c8=""><h2 _ngcontent-c8="" class="fw600 ft17">Mobile Recharge</h2><div _ngcontent-c8=""><p class="ft13">Mobile phones are an intrinsic part of our lives and with association so is mobile recharge. Online mobile recharge gives you the liberty to recharge your mobile phone number anytime and from anywhere - be it from home, office, restaurant or holiday and all you need is internet access. When you think of easy recharge options, MobiKwik is the best.</p> <p class="ft13">Mobikwik is India's No. 1 Online Recharge site for Airtel, Vodafone, Idea, Tata Indicom,Reliance, Bsnl, Aircel, Tata Docomo. Mobikwik does not charge you over any online mobile recharges done and you can save your time, effort and money. Browse for the cheapest talk time &amp; data plans using Mobikwik.com.</p><p class="ft13">You can do <a href="/prepaid-recharge">prepaid online recharge</a> and bill payments for any number, recharge for your friends and family with ease using MobiKwik. Recharge through Net Banking, Debit Card, Credit Card, Visa or Master Card and MobiKwik wallet. HDFC, SBI, CITI &amp; ICICI banks and a host of other banks supports Net Banking online recharge with ease.</p></div></div><div _ngcontent-c8=""><h2 _ngcontent-c8="" class="fw600 ft17">Online Bill Payment</h2><div _ngcontent-c8=""><p class="ft13">We also offer Bill Payments - Landline, Electricity, Insurance and Gas Bill payments can be done effortlessly. Sign up and enjoy great online bill payment services through Mobikwik.com. Data Card online recharge and bill payment for Idea netsetter, MTS Mblaze and Tata Photon can be done with ease on MobiKwik. <a href="/dth-recharge">DTH recharge</a> with MobiKwik is quick and easy and you can even browse for subscription plans. We offer Airtel DTH, Dish TV, Sun Direct, Tata Sky, Videocon D2H and Reliance Big TV DTH online recharge and bill payments.</p> <p class="ft13">With an objective of simplifying the mobile recharge process, MobiKwik lets you browse through a list of data plans and make your pick depending on your usage. Whether you are making a postpaid bill payment or a prepaid recharge, you can now save both time and energy and have plans on the tip of your fingers. With MobiKwik, you can stay connected and make your online recharge at any time of the day. You can also use the MobiKwik portal to shop, pay your bills, and recharge both mobile and DTH connections on the go. And with the MobiKwik app for Windows, iOS and Android, you can also make your online mobile recharge transactions through your phones.</p></div></div><div _ngcontent-c8=""><h2 _ngcontent-c8="" class="fw600 ft17">Why You Should Use MobiKwik?</h2><div _ngcontent-c8=""><p class="ft13">MobiKwik is India's largest issuer-independent digital financial services platform, leveraging a sophisticated product and merchant acquisition capabilities. It is the undisputed No.2 player in the mobile wallet space in India and amongst the top 3 players in the payment gateway industry in the country. It has a network of over 3 million direct merchants, 140+ billers and 107 million-plus users. It records over 1 million transactions/ day.</p> <p class="ft13">Founded in 2009 by Bipin Preet Singh &amp; Upasana Taku, MobiKwik is backed by marquee investors including Sequoia Capital, American Express, Tree Line Asia, MediaTek, GMO Payment Gateway, Cisco Investments, Net1 and Bajaj Finance.</p> <p class="ft13">MobiKwik has grown by leaps and bounds over the past few years. The company has clocked a 4x growth in transactions on YoY basis. The brand vision is to enable a billion Indians with one tap access to digital payments, loans, investments and insurance by the year 2022.</p> <p class="ft13">The MobiKwik wallet can be used across a host of payments services, including bill recharges, utility bill payments, cab bookings, ticket bookings, payments for groceries, as well as payments to online digital and offline retail stores. MobiKwik bridges the digital divide between consumers and companies via swift recharges and bill payments at no extra cost for its online transactions. Be it prepaid, postpaid, DTH, data card, electricity, life insurance, landlines, gas, water, broadband, cable, municipality or Metro payments and traffic challans, MobiKwik is best for one and all. The app also offers instant money transfer to family and friends with ease.</p> <p class="ft13">MobiKwik is well known for its product innovation and cutting-edge technology. Earlier this year, it rolled out the first-of-its-kind instant credit product called 'Boost' that ensures loan disbursal in a matter of 90 seconds. MobiKwik is the first in the industry to give loans in a mobile wallet. It will be adding new products in its lending portfolio in the near future. With an extensive range of offerings in lending, MobiKwik is on track to become one of India's largest lenders, in the times to come.</p> <p class="ft13">MobiKwik also announced its foray in wealth management with 100% acquisition of Clearfunds, one of India's leading new age wealth management platforms. It has also recently launched the digital gold category on its platform. The company will also be rolling out other financial services like insurance, as it targets to achieve a four-fold growth in FY 18-19.</p></div></div><div _ngcontent-c8=""><h2 _ngcontent-c8="" class="fw600 ft17">Get instant personal loans on MobiKwik</h2><div _ngcontent-c8=""><p class="ft13">Personal loans are small unsecured loans taken for personal uses such as funding a vacation,household repairs, tuition fees etc. By Unsecured, we mean that loans are available without any collateral or security. A user can avail <a href="/loans"> instant personal loans</a> online via MobiKwik. MobiKwik offer instant personal loan and the instant loan online can be availed without pledging any security. A user has to provide only a few basic details to avail the instant personal loan online. Personal loan online on MobiKwik comes with various benefits.</p> <ol> <li>Minimal documentation</li> <li>No collateral required</li><li>Simple and quick process</li> <li>Bank transfer option available</li> </ol></div></div><div _ngcontent-c8=""><h2 _ngcontent-c8="" class="fw600 ft17">Get online insurance starting at just Rs 20</h2><div _ngcontent-c8=""><p class="ft13">Insurance policy is a contract that protects the policyholder from financial losses and reimburses for any financial damage. MobiKwik offers to its users, insurance cover starting and just Rs 20. Through the MobiKwik app or website, a user can purchase <a href="/insurance/life-insurance">life insurance</a>, <a href="/insurance/personal-accident-insurance">personal accidental insurance</a> and <a href="/insurance/cyber-insurance">cyber fraud insurance</a>, thus insuring instant purchases of insurance online with minimum cost and maximum transparency. Buying <a href="/insurance">insurance online</a> via MobiKwik offers various advantages; Insurance covers online are available at low cost  premiums and the process of buying insurance cover online is easy and quick. Thus, MobiKwik is the ideal platform to buy low cost insurance covers online. </p></div></div><div _ngcontent-c8=""><h2 _ngcontent-c8="" class="fw600 ft17"></h2><div _ngcontent-c8="">You can also get covered for <a href="/insurance/coronavirus-insurance">Coronavirus Insurance</a> on MobiKwik. The process to get protected is very simple, quick and involves minimal documentation. Get a cover against Coronavirus Insurance on MobiKwik now.</div></div></section></mbk-home-page></div><mbk-footer _ngcontent-c4="" _nghost-c6=""><h2 _ngcontent-c6="" class="ft17 fw600 sptop20">Popular Searches on MobiKwik</h2><div _ngcontent-c6=""><a _ngcontent-c6="" class="spright40 smtop8 smbottom8 tgreyteel dpInBLock vtop" href="/prepaid-recharge"><span _ngcontent-c6="">Online Recharge</span></a><a _ngcontent-c6="" class="spright40 smtop8 smbottom8 tgreyteel dpInBLock vtop" href="/electricity-bill-payment"><span _ngcontent-c6="">Electricity Bill Payments<